#       WHERE service.NAME = 'SLC'
#       AND names.ATTRIBUTE NOT IN ('PDES', 'KPHR', 'PCON', 'ACON')
#       ORDER BY names.ATTRIBUTE, names.INSTANCE
# @endcode
